    IF TG_TABLE_NAME IN ('authors', 'librarians', 'readers') THEN
        IF NEW.surname IS NOT NULL THEN NEW.surname := initcap(NEW.surname); END IF;
        IF NEW.first_name IS NOT NULL THEN NEW.first_name := initcap(NEW.first_name); END IF;
