CREATE FUNCTION public.format_text_content() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
    -- Жанры и Статьи штрафов
    IF TG_TABLE_NAME IN ('genres', 'fine_articles') THEN
        NEW.name := initcap(NEW.name);
        
        -- Для штрафов делаем только первую букву заглавной (по вашему желанию)
        IF TG_TABLE_NAME = 'fine_articles' THEN
             NEW.name := concat(upper(substr(NEW.name, 1, 1)), substr(NEW.name, 2));
        END IF;

        IF NEW.description IS NOT NULL THEN
            NEW.description := concat(upper(substr(NEW.description, 1, 1)), substr(NEW.description, 2));
        END IF;
    END IF;

    -- Книги
    IF TG_TABLE_NAME = 'books' THEN
        NEW.title := concat(upper(substr(NEW.title, 1, 1)), substr(NEW.title, 2));
    END IF;

    RETURN NEW;
END;
$$;


