CREATE FUNCTION public.get_report_debtors() RETURNS TABLE("№ Билета" integer, "Читатель" text, "Телефон" character varying, "Книга" character varying, "Дата возврата" date, "Просрочка (дней)" integer)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        r.ticket_number,
        (r.surname || ' ' || r.first_name)::TEXT,
        r.phone,
        b.title::VARCHAR,
        len.due_date,
        (CURRENT_DATE - len.due_date)::INT -- Разница в днях
    FROM lendings len
    JOIN readers r ON len.reader_ticket_number = r.ticket_number
    JOIN copies c ON len.copy_inventory_number = c.inventory_number
    JOIN books b ON c.book_isbn = b.isbn
    WHERE len.return_date IS NULL          -- Книга не возвращена
      AND len.due_date < CURRENT_DATE      -- Срок вышел
    ORDER BY len.due_date ASC;
END;
$$;


