CREATE FUNCTION public.get_report_librarian_efficiency(start_date date, end_date date) RETURNS TABLE("Таб. номер" integer, "ФИО сотрудника" text, "Выдано книг" bigint)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        l.tabel_number,
        -- Склеиваем ФИО. COALESCE нужен, чтобы NULL не испортил всю строку
        (l.surname || ' ' || l.first_name || ' ' || COALESCE(l.patronymic, ''))::TEXT,
        COUNT(len.lending_id)
    FROM librarians l
    LEFT JOIN lendings len ON l.tabel_number = len.librarian_tabel_number
    -- Фильтруем по дате выдачи
    WHERE len.lend_date BETWEEN start_date AND end_date
    GROUP BY l.tabel_number, l.surname, l.first_name, l.patronymic
    ORDER BY COUNT(len.lending_id) DESC;
END;
$$;


