CREATE FUNCTION public.get_report_popular_books(start_date date, end_date date) RETURNS TABLE("ISBN" character varying, "Название" character varying, "Автор" text, "Кол-во выдач" bigint)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        b.isbn,
        b.title,
        -- Формируем "Фамилия И."
        (a.surname || ' ' || left(a.first_name, 1) || '.')::TEXT,
        COUNT(len.lending_id)
    FROM books b
    JOIN copies c ON b.isbn = c.book_isbn
    JOIN lendings len ON c.inventory_number = len.copy_inventory_number
    -- Используем LEFT JOIN, чтобы книги без авторов тоже попали (хотя таких быть не должно)
    LEFT JOIN book_authors ba ON b.isbn = ba.book_isbn
    LEFT JOIN authors a ON ba.author_id = a.author_id
    WHERE len.lend_date BETWEEN start_date AND end_date
    GROUP BY b.isbn, b.title, a.surname, a.first_name
    ORDER BY COUNT(len.lending_id) DESC
    LIMIT 20; -- Топ 20
END;
$$;


