-- Name: prevent_deletion_if_dependencies_exist(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.prevent_deletion_if_dependencies_exist() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    dependency_count INTEGER;
BEGIN
    -- Авторы
    IF TG_TABLE_NAME = 'authors' THEN
        SELECT COUNT(*) INTO dependency_count FROM book_authors WHERE author_id = OLD.author_id;
        IF dependency_count > 0 THEN RAISE EXCEPTION 'Нельзя удалить автора, у него есть книги (%)', dependency_count; END IF;
    END IF;

    -- Жанры
    IF TG_TABLE_NAME = 'genres' THEN
        SELECT COUNT(*) INTO dependency_count FROM book_genres WHERE genre_id = OLD.genre_id;
        IF dependency_count > 0 THEN RAISE EXCEPTION 'Нельзя удалить жанр, он используется в книгах (%)', dependency_count; END IF;
    END IF;

    -- Книги
    IF TG_TABLE_NAME = 'books' THEN
        SELECT COUNT(*) INTO dependency_count FROM copies WHERE book_isbn = OLD.isbn;
        IF dependency_count > 0 THEN RAISE EXCEPTION 'Нельзя удалить книгу, есть экземпляры (%)', dependency_count; END IF;
    END IF;

    -- Читатели
    IF TG_TABLE_NAME = 'readers' THEN
        SELECT COUNT(*) INTO dependency_count FROM lendings WHERE reader_ticket_number = OLD.ticket_number AND return_date IS NULL;
        IF dependency_count > 0 THEN RAISE EXCEPTION 'Читатель не вернул книги (%)', dependency_count; END IF;
    END IF;

    -- ПОСТАВЩИКИ (Suppliers)
    IF TG_TABLE_NAME = 'suppliers' THEN
        SELECT COUNT(*) INTO dependency_count FROM deliveries WHERE supplier_inn = OLD.inn;
        IF dependency_count > 0 THEN 
            RAISE EXCEPTION 'Нельзя удалить поставщика "%", так как от него были поставки книг (кол-во: %).', OLD.name, dependency_count; 
        END IF;
    END IF;

    -- СТАТЬИ ШТРАФОВ (Fine Articles)
    IF TG_TABLE_NAME = 'fine_articles' THEN
        SELECT COUNT(*) INTO dependency_count FROM fines WHERE article_id = OLD.article_id;
        IF dependency_count > 0 THEN 
            RAISE EXCEPTION 'Нельзя удалить статью штрафа "%", так как она используется в истории штрафов (кол-во записей: %).', OLD.name, dependency_count; 
        END IF;
    END IF;

    RETURN OLD;
END;
$$;


ALTER FUNCTION public.prevent_deletion_if_dependencies_exist() OWNER TO postgres;

