CREATE FUNCTION public.validate_author_rules() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
BEGIN
    -- Проверка на недопустимые символы в ФИО
    IF (NEW.surname !~ '^[A-Za-zА-Яа-яЁё\s-]+$') OR 
       (NEW.first_name !~ '^[A-Za-zА-Яа-яЁё\s-]+$') OR 
       (NEW.patronymic IS NOT NULL AND NEW.patronymic !~ '^[A-Za-zА-Яа-яЁё\s-]+$') THEN
         RAISE EXCEPTION 'Ошибка: ФИО автора содержит недопустимые символы.';
    END IF;

    -- Проверка на смешивание языков
    IF (NEW.surname ~ '[а-яА-ЯёЁ]' AND NEW.surname ~ '[a-zA-Z]') OR
       (NEW.first_name ~ '[а-яА-ЯёЁ]' AND NEW.first_name ~ '[a-zA-Z]') THEN
         RAISE EXCEPTION 'Ошибка: В ФИО нельзя смешивать русские и английские буквы!';
    END IF;

    RETURN NEW;
END;
$_$;


