CREATE FUNCTION public.validate_language_content() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    j_row JSONB := to_jsonb(NEW); -- Превращаем строку в JSON для безопасного чтения
BEGIN
    -- 1. Смешивание языков в ФИО (читаем безопасно через json)
    IF TG_TABLE_NAME IN ('authors', 'readers', 'librarians') THEN
        IF (j_row->>'surname' ~ '[а-яА-ЯёЁ]' AND j_row->>'surname' ~ '[a-zA-Z]') OR
           (j_row->>'first_name' ~ '[а-яА-ЯёЁ]' AND j_row->>'first_name' ~ '[a-zA-Z]') OR
           (j_row->>'patronymic' IS NOT NULL AND j_row->>'patronymic' ~ '[а-яА-ЯёЁ]' AND j_row->>'patronymic' ~ '[a-zA-Z]') THEN
            RAISE EXCEPTION 'Ошибка в ФИО: Нельзя смешивать русские и английские буквы!';
        END IF;
    END IF;

    -- 2. Адреса (только русский)
    IF TG_TABLE_NAME IN ('readers', 'suppliers') THEN
        IF j_row->>'address' ~ '[a-zA-Z]' THEN
            RAISE EXCEPTION 'Ошибка: Адрес должен быть на русском языке (без латиницы).';
        END IF;
    END IF;

    -- 3. Города (издательства)
    IF TG_TABLE_NAME = 'publishers' AND j_row->>'city' ~ '[a-zA-Z]' THEN
        RAISE EXCEPTION 'Ошибка: Город должен быть написан на русском языке.';
    END IF;

    -- 4. Жанры, Штрафы (Название, Описание)
    IF TG_TABLE_NAME IN ('genres', 'fine_articles') THEN
        IF j_row->>'name' ~ '[a-zA-Z]' THEN
             RAISE EXCEPTION 'Ошибка: Название должно быть на русском языке.';
        END IF;
        IF j_row->>'description' ~ '[a-zA-Z]' THEN
             RAISE EXCEPTION 'Ошибка: Описание должно быть на русском языке.';
        END IF;
    END IF;

    -- 5. Списания (Причина)
    IF TG_TABLE_NAME = 'write_offs' AND j_row->>'reason' ~ '[a-zA-Z]' THEN
        RAISE EXCEPTION 'Ошибка: Причина списания должна быть на русском языке.';
    END IF;

    RETURN NEW;
END;
$$;


