--
-- TOC entry 269 (class 1255 OID 18184)
-- Name: validate_reader_librarian_rules(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.validate_reader_librarian_rules() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
BEGIN
    -- Проверка ФИО
    IF (NEW.surname !~ '^[A-Za-zА-Яа-яЁё\s-]+$') OR 
       (NEW.first_name !~ '^[A-Za-zА-Яа-яЁё\s-]+$') OR 
       (NEW.patronymic IS NOT NULL AND NEW.patronymic !~ '^[A-Za-zА-Яа-яЁё\s-]+$') THEN
         RAISE EXCEPTION 'Ошибка: ФИО содержит недопустимые символы.';
    END IF;

    -- Смешивание языков
    IF (NEW.surname ~ '[а-яА-ЯёЁ]' AND NEW.surname ~ '[a-zA-Z]') OR
       (NEW.first_name ~ '[а-яА-ЯёЁ]' AND NEW.first_name ~ '[a-zA-Z]') THEN
         RAISE EXCEPTION 'Ошибка: В ФИО нельзя смешивать языки!';
    END IF;

    -- Проверка ТЕЛЕФОНА (Здесь это безопасно, так как у читателей и библиотекарей есть поле phone)
    IF NEW.phone !~ '^\+7[0-9]{10}$' THEN
        RAISE EXCEPTION 'Ошибка: Неверный формат телефона "%". Ожидается формат: +7XXXXXXXXXX (всего 11 цифр, начинается с +7).', NEW.phone;
    END IF;

    -- Специфично для Читателей (Паспорт и Адрес)
    IF TG_TABLE_NAME = 'readers' THEN
         IF NEW.address ~ '[a-zA-Z]' THEN
            RAISE EXCEPTION 'Ошибка: Адрес читателя должен быть на русском языке.';
         END IF;
         IF NEW.passport_series !~ '^[0-9]{4}$' OR NEW.passport_number !~ '^[0-9]{6}$' THEN
            RAISE EXCEPTION 'Ошибка: Неверный формат паспорта.';
         END IF;
    END IF;

    RETURN NEW;
END;
$_$;


ALTER FUNCTION public.validate_reader_librarian_rules() OWNER TO postgres;

--
-- TOC entry 267 (class 1255 OID 18172)
-- Name: validate_supplier_rules(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.validate_supplier_rules() RETURNS trigger
    LANGUAGE plpgsql
    AS $_$
BEGIN
    -- 1. ПРОВЕРКА ТЕЛЕФОНА
    -- Если формат не подходит под +7XXXXXXXXXX
    IF NEW.phone !~ '^\+7[0-9]{10}$' THEN
        RAISE EXCEPTION 'Ошибка: Неверный формат телефона "%". Ожидается формат: +7XXXXXXXXXX (всего 11 цифр, начинается с +7).', NEW.phone;
    END IF;

    -- 2. ПРОВЕРКА EMAIL
    -- Если нет "собаки", точки или странные символы
    IF NEW.email !~* '^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}$' THEN
        RAISE EXCEPTION 'Ошибка: Неверный формат Email "%". Пример верного формата: example@mail.ru', NEW.email;
    END IF;

    -- 3. ПРОВЕРКА ИНН
    -- Должно быть строго 10 или 12 цифр
    IF NEW.inn !~ '^[0-9]{10}$' AND NEW.inn !~ '^[0-9]{12}$' THEN
        RAISE EXCEPTION 'Ошибка: Неверный ИНН "%". ИНН должен состоять строго из 10 или 12 цифр (без букв и пробелов).', NEW.inn;
    END IF;

    -- 4. ПРОВЕРКА АДРЕСА
    -- Только русский язык
    IF NEW.address ~ '[a-zA-Z]' THEN
        RAISE EXCEPTION 'Ошибка: Адрес поставщика должен быть написан на русском языке.';
    END IF;

    RETURN NEW;
END;
$_$;


